import React from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import './Restaurant.css';

import Navbar from "./components/navbar.restaurant"

import RestaurantLogin from "./components.r/loginpage.restaurant"
import RestaurantProfile from "./components.r/res_system.restaurant"
import CreateRestaurant from "./components.r/createRestaurant.restaurant"
import RestaurantEvent from "./components.r/eventspage.restaurant"
import RestaurantBalance from "./components.r/accountbalance.restaurant"
import RestaurantPage from "./components.r/yourpage.restaurant"

function Restaurant() {
    return (

     <Router>
     <Navbar />

        <Route path = "/login" exact component = {RestaurantLogin}/>
        <Route path = "profile" exact component = {RestaurantProfile}/> 
        <Route path = "/register" exact component = {CreateRestaurant}/> 
        <Route path = "/event" exact component = {RestaurantEvent}/>
        <Route path = "/payment" exact component = {RestaurantBalance}/>
        <Route path = "/yourpage" exact component = {RestaurantPage}/>


      </Router>


    );
  }

  export default Restaurant;
